ngồi hoặc đứng thì bình thường, nhưng nằm xuống thì cổ mũi khò khè, cảm giác có đàm trong cổ họng, hơi thở nghe rõ do khò khè, bình thường ngủ gối thấp của em bé, giờ phải kê gối cao để đỡ khò khè, nằm thì nghe hơi thở khò khè, nhưng khi ngồi lên hoặc đứng dậy thì bình thường, do đó giấc ngủ không được thoải mái do hơi thở nghe to rõ;
triệu chứng này xảy ra khoảng 10 ngày đổ lại, vẫn ăn uống vui khỏe, k có triệu chứng ho, sốt nhức đầu gì cả;
cách đây hơn 5 năm thì có tiểu phẩu lệch vách ngăn mũi trái , sau đó có phẩu thuật dịch vụ chữa ngủ ngáy ở bv tai mũi họng tp.hcm.
